def calculate_min_time(S1: int, S2: int, N: int) -> int:
    (st, en) = (0, N)
    ans = 100000000000000000000
    while st <= en:
        mid = (st + en) // 2
        ans = min(ans, max(S1 * mid, S2 * (N - mid)))
        if S1 * mid > S2 * (N - mid):
            en = mid - 1
        else:
            st = mid + 1
    return ans

